import sliderMorrison from "./jimMorrison/fotos"
import sliderPikachu from "./pikachu/fotos"
export const artWork = {
    pikachu: {
        title: "Pikachu",
        fotos: sliderPikachu    
    },
    morrison: {
        title: "Morrison",
        fotos: sliderMorrison,
    }
}
